import React from "react";
import classes from "./Skill.module.css";

const Skill = () => {
  return (
    <div className={classes.skill}>
      <div className={classes.content}>
        <div className={classes.skill__title}>
          <span>- Skills</span>
          <h3>My Skills</h3>
        </div>
      </div>
    </div>
  );
};

export default Skill;
